        fakeAuth.isAuthenticated ? (
          children
        ) : (
          <Redirect
            to={{
              pathname: "/login",
              state: { from: location }
            }}
          />
        )
      }
    />
  );
}


  render() {
    return (
        <div>
          <Navbar />
          <Switch>
            <Route path='/' exact >
              <Landing />
              <ContentSection />
            </Route>
            <Route path='/login' render={ () => <Login />} />
            <Route path='/signup' render={ () => <Signup />} />
            <Route path='/profile' render={ () => <Profile />} />
          </Switch>
        </div>
    )
  }

}
export default App;
